
from django.contrib.auth import get_user_model
from rest_framework.test import APITestCase, APIClient
from api.models import Pregunta, Auditoria, Respuesta, Sucursal


class RespuestaViewTestCase(APITestCase):

    def setUp(self):
        self.client = APIClient()
        self.user = get_user_model().objects.create_user(username='test', email='test@example.io', password='test123')
        self.client.force_authenticate(user=self.user)

    # recomiendo no abrir este test

    def test_create_201(self):
        test_suc = Sucursal.objects.create(nombre="Nuevo Centro", numero_de_sag="1", telefono="1")
        test_suc2 = Sucursal.objects.create(nombre="Nuevo Centro", numero_de_sag="2", telefono="2")

        audit1 = Auditoria.objects.create(sucursal=test_suc)
        audit2 = Auditoria.objects.create(sucursal=test_suc2)

        preg = Pregunta.objects.create(pregunta="El test funciona bien?", seccion="Adentro", categoria="DIGEFE", tipo="Audio")

        resp1 = self.client.post('/api/auditorias/respuesta/', {'auditoria': audit1.id, 'pregunta': preg.id, 'usuario': self.user.id})
        audio = "data:audio/mpeg;base64,"

        resp2 = self.client.post('/api/auditorias/respuesta/', {'auditoria': audit2.id, 'pregunta': preg.id, 'usuario': self.user.id, 'audio': audio})
        self.assertEqual(resp1.status_code, 201)
        self.assertEqual(resp2.status_code, 201)

    def test_create_400(self):
        test_suc = Sucursal.objects.create(nombre="Nuevo Centro", numero_de_sag="1")
        test_suc2 = Sucursal.objects.create(nombre="Nuevo Centro", numero_de_sag="1", telefono="2")
        Auditoria.objects.create(sucursal=test_suc)
        Auditoria.objects.create(sucursal=test_suc2)
        Pregunta.objects.create(pregunta="El test funciona bien?", seccion="Adentro", categoria="DIGEFE", tipo="Audio")
        get_user_model().objects.create(username="Sher", email="sher@gmail.com", password="123456")

        resp = self.client.post('/api/auditorias/respuesta/', {'auditoria': 3, 'pregunta': 1, 'usuario': 1})
        resp2 = self.client.post('/api/auditorias/respuesta/', {'auditoria': 1, 'pregunta': 3, 'usuario': 1})
        resp3 = self.client.post('/api/auditorias/respuesta/', {'auditoria': 1, 'pregunta': 1, 'usuario': 3})
        resp4 = self.client.post('/api/auditorias/respuesta/', {'pregunta': 1, 'usuario': 1})
        resp5 = self.client.post('/api/auditorias/respuesta/', {'auditoria': 1, 'usuario': 1})
        resp6 = self.client.post('/api/auditorias/respuesta/', {'auditoria': 1, 'pregunta': 1})
        self.assertEqual(resp.status_code, 400)
        self.assertEqual(resp2.status_code, 400)
        self.assertEqual(resp3.status_code, 400)
        self.assertEqual(resp4.status_code, 400)
        self.assertEqual(resp5.status_code, 400)
        self.assertEqual(resp6.status_code, 400)
